      <Card className={"d-flex justify-content-center"} titulo={"Tercera Card"} imagen={"https://picsum.photos/200/300"} parrafo={"parrafo Card"} boton={" btn btn-info"} botonText={"Comprar"} />
      </div>
    </Main>
    </>
  );
}

export default App;
